        $porvinceId = 0;
        $cityId = 0;
        for ($i=0; $i<$length-1; $i++) {
            $parentId = $cityId;
            $info = array();
            $type = 2;
            if (preg_match("/\d{2}0000/", $ids[0][$i])) {
                $type = 0;
                $parentId = $countryId;
            } else if (preg_match("/\d{3}[1-9]00/", $ids[0][$i])) {
                $type = 1;
                $parentId = $porvinceId;
            }

            $info['parent_id'] = $parentId;
            $info['region_no'] = $ids[0][$i];
            $info['region_name'] = trim($names[0][$i]);
            $info['region_type'] = $type;
            $id = $this->Region_model->add($info);
            if ($type == 2) {
                $parentId = $cityId;
            } else if ($type == 1) {
                $parentId = $porvinceId;
                $cityId = $id;
            } else {
                $porvinceId = $id;
            }
        }
